import React from "react";
import MovieCard from "./MovieCard";
import "../index.css";

function MovieList({ movie }) {
  const movies = [1, 2, 3];
  return (
    <div className="movielist">
      {movies.map((el, i) => (
        <MovieCard
          title={movie.title}
          posterUrl={movie.posterUrl}
          description={movie.description}
          key={i}
        />
      ))}
    </div>
  );
}

export default MovieList;
